INSERT INTO `ps_request_sql` VALUES (1,'Katalog > Pliki','SELECT b.*, a.*\r\n, IFNULL(virtual_product_attachment.products, 0) as products\r\nFROM `ps_attachment` a \r\nLEFT JOIN `ps_attachment_lang` b\r\n                ON (b.`id_attachment` = a.`id_attachment` AND b.`id_lang` = 1)\r\nLEFT JOIN (SELECT id_attachment, COUNT(*) as products FROM ps_product_attachment GROUP BY id_attachment) virtual_product_attachment ON a.id_attachment = virtual_product_attachment.id_attachment \r\n WHERE 1 \r\n\r\n ORDER BY a.id_attachment ASC');
/*!40000 ALTER TABLE `ps_request_sql` ENABLE KEYS */;
UNLOCK TABLES;

